// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.6.0;

import "@openzeppelin/contracts/utils/Create2.sol";
import "./BounceERC721.sol";
import "./BounceERC1155.sol";

contract BounceNFTFactory {

    event Brand721Created(address indexed user, address nft);
    event Brand1155Created(address indexed user, address nft);

    mapping(address => address) public brands;

    function createBrand721(string calldata _name, string calldata _symbol) brandNotCreated(msg.sender) external {
        bytes memory bytecode = abi.encodePacked(type(BounceERC721).creationCode, abi.encode(_name, _symbol));
        bytes32 salt = keccak256(abi.encodePacked(msg.sender, _name, _symbol));
        address nft = Create2.deploy(0, salt, bytecode);
        brands[msg.sender] = nft;
        BounceERC721(nft).transferOwnership(msg.sender);
        emit Brand721Created(msg.sender, nft);
    }

    function createBrand1155(string calldata _uri) brandNotCreated(msg.sender) external {
        bytes memory bytecode = abi.encodePacked(type(BounceERC1155).creationCode, abi.encode(_uri));
        bytes32 salt = keccak256(abi.encodePacked(msg.sender, _uri));
        address nft = Create2.deploy(0, salt, bytecode);
        brands[msg.sender] = nft;
        BounceERC1155(nft).transferOwnership(msg.sender);
        emit Brand1155Created(msg.sender, nft);
    }

    modifier brandNotCreated(address _user) {
        require(brands[_user] == address(0), "ALREADY CREATED");
        _;
    }
}
